import React from 'react';
import styled from 'styled-components';
import Todoitem from './Todoitem';
import { useTodoState } from '../TodoContext';

const Todolistbox = styled.div`
  flex: 1;
  padding: 20px 32px;
  padding-bottom: 48px;
  overflow-y: auto;

`;

function Todolist() {
  const todos = useTodoState();
  return <Todolistbox>
    <Todoitem text = "아침에 밥먹기" done={true} />
    <Todoitem text = "점심에 밥먹기" done={true} />
    <Todoitem text = "저녁에 밥먹기" done={false} />
    <Todoitem text = "밥먹었으니까 떵" done={true} />
  </Todolistbox>;
}

export default Todolist;
